    false,nt"url": null,nt"notes": "This annual narrative report for Crab Orchard
    National Wildlife Refuge summarizes refuge activities during the 1992 calendar year.
     The report begins with a summary of the yearu2019s highlights and climatic conditions.
     Land acquisition - including fee titles and easements topics are also covered.
     The report includes a planning section which discusses refuge management plans
    and compliance projects.  Refuge administration is outlined; information about personnel,
    refuge programs, funding and safety is given.  Habitat management is also covered.
     Subjects include wetlands, croplands, grasslands, fire management, and wilderness
    areas.  The wildlife section of the report discusses endangered or threatened species,
    migratory birds, game mammals, fisheries resources, banding, and disease control.
     The public uses of the refuge described in this report include interpretive programs,
    hunting, fishing, wildlife observation, and law enforcement.  The equipment and
    facilities section of the report provides information about new construction, maintenance,
    and computer systems.  Items of interest are provided at the end.",nt"license_title":
